with open('input.txt', 'r') as input_file: input_data = [int(i) for i in input_file.read().split('\n')]; print(str([x for x in [[z1 * z2 for z2 in input_data[count1:] if z1 + z2 == 2020] for count1, z1 in enumerate(input_data)] if x][0][0]) + '\n' + str([y for y in [[x for x in [[z1 * z2 * z3 for z3 in input_data[count2:] if z1 + z2 + z3 == 2020] for count2, z2 in enumerate(input_data[count1:])] if x] for count1, z1 in enumerate(input_data)] if y][0][0][0]))